import {
  HideBetween,
  HideDuring,
  HideOn,
  HideScroll,
} from "react-hide-on-scroll";
import './App.css';

import Header from "./Components/Header";
import Landing from "./Components/Landing"
import About from "./Components/About"
import Resume from "./Components/Resume"
import Portfolio from "./Components/Portfolio"
import Contact from "./Components/Contact"

function App() {
  return (
    <div className="App">

      <div style={{height: '50px'}} id='home'/>
      <HideDuring inverse showOnPageInit={true}>
        <Header/>
      </HideDuring>
      {/* <HideScroll variant="down" showOnPageInit={true}>
        <HideScroll variant="up">
          <Header/>
        </HideScroll>
      </HideScroll> */}
      <Landing/>
      <About/>
      <Resume/>
      <Portfolio/>
      <Contact/>

      <div id="contact" style={{height: '2000px', width: "100%", backgroundColor: 'red'}}>
        div filler
      </div>
    </div>
  );
}

export default App;
